import React from 'react';
import { useState, useEffect } from 'react';
import $ from 'jquery';
import PlanCard from './util/PlanCard';

function Plans() {
    const [plans, setPlans] = useState([]);
    useEffect(() => {
        $("#view-plans-btn").click(() => {
            $('html, body').animate({
                scrollTop: $(".plans").offset().top - 50
            }, 1);
        });

        const tempPlans = [
            {
                name: 'Free',
                amount: 0,
                contains: [
                    {
                        name: 'Create 2 exams',
                        type: 1
                    },
                    {
                        name: 'Add 2 section per exam',
                        type: 1
                    },
                    {
                        name: 'Maximum 10 question per section',
                        type: 1
                    },
                    {
                        name: 'Timer Exam',
                        type: 1
                    },
                    {
                        name: 'Can not create user',
                        type: 0
                    },
                    {
                        name: 'Can not create user',
                        type: 0
                    },
                ]
            }
        ];
        setPlans(tempPlans);

    }, []);
  return (
      <div className='plans'>
        <h1>Administrator Plans</h1>
        <div className='plan-row'>
            {
                plans.map((d, key) => {
                    return <PlanCard 
                        name={d.name}
                        amount={d.amount}
                        contains={d.contains}
                    />
                })
            }
        </div>
      </div>
  );
}

export default Plans;
